import "./login.scss"


const Login = () => {
    return(
        <div className="Login">
            <div className="card">
                <div className="left">
                  <h1>Welcome to the DOG PARK</h1>
                  <p> Do you wanna join the newest social media platform thats sweeping the nation,
                    CODED BY UMBC STUDENTS FOR UMBC STUDENTS,
                    Join today 
                  </p>
                    <span> Do you not have an account?</span>
                    <button>Register Here</button>
                </div>
                <div className="right"></div>
            </div>
        </div>

    );


};
export default Login
